	('18e72100-1217-43f5-b15d-fc3185763bfd', '07bf233b-a07f-426b-948d-486cbb43b204', 'Ideation Process', 'text', '{"text": "<b>Task:</b> You now have 5 mins to create as many different pencil case designs as you can."}', false, 2, true, false, NULL),
