	('bc6bb66c-560f-4329-92da-bc37eece74c0', '07bf233b-a07f-426b-948d-486cbb43b204', 'Task:  Create 15 Initial Sketches & 1 Selected Sketch', 'text', '{"text": "In the worksheet, create 15 initial sketches.<div>Then create 1 selected design.</div>"}', true, 5, true, false, NULL),
